import React from 'react'
import logo from '../../images/Alto_logo.png';
import kabob from '../../images/Kabob_nav.png';
import info from '../../images/Info_icon.png';
import "./Page1.css";

function Line() {
    return <hr className="line" />;
}

function Info(props) {
    return <div>{props.item}</div>;
}

function Item(props) {
    return <div>{props.info}</div>;
}

function Item2(props) {
    return <div>{props.info}
    <img src={info} className="info-icon" alt="info" /></div>;
}

const Page1 = () => {
    return (
        <div className="main">
                <img src={logo} className="logo" alt="logo" />
                <div className="trip">Your Trip</div>
                <img src={kabob} className="kabob" alt="kabob" />

            <section className="main-section">
                <h1 className="time">5:39 PM</h1>
                <p className="estimated">Estimated arrival at DFW Int'l Airport - Terminal E</p>
            </section>

            <div className="sec1">
                <Line />
                <Info item="Estimated Fare:" />
                <Item2 info="$65 - $75" />
            </div>
            <div className="sec2">
                <Line />
                <Info item="Passengers:" />
                <Item info="1 - 5" />
            </div>
            <div className="sec3">
                <Line />
                <Info item="Payment:" />
                <Item info="Amex01" />
            </div>

            <div className="info">
                449 Flora St.
                Dallas, Texas 75201
                <hr className="line" />
                <p className="dfw-info">
                DFW International Airport
                American Airlines Terminal E
                Irving, Texas 75261
                </p>

                <p className="AA">
                Can you drop me off at AA
                International Bag Drop please?
                </p>
            </div>

            <div className="info2"></div>
            <div className="info3"></div>

            <div className="cancel">
                <div className="boxed">
                    CANCEL TRIP
                </div>
            </div>
        </div>
    )
}

export default Page1
